import React from 'react';
import {Link} from 'react-router-dom';
import '../EstilosCss/Card.css';

function Card({data}) {
	return (
		<div className='card'>
			<Link to={`/videogames/${data.id}`}>
				{data.image === null || !data.image ? (
					<img className = "img" src="https://www.alpha-editorial.com/images/loading.gif" alt="Link caido"/>
				) : (
					<img className='img' src={data.image} alt={data.name} />
				)}
			</Link>
			<div className='textCard'>
				<div className='nameGenres'>
					<div className='name'>{data.name}</div>
					<div className='genres'>{data.genres}</div>
				</div>
				
			</div>
			<div className='divRating'>
					<div className='rating'>{data.rating}</div>
				</div>
		</div>
	);
}

export default Card;
